import React from 'react';
import divStyle from '../AppStyle';

function ExtObjectVarCSS() {
	return (
		<div style={ divStyle }>
			<h1>Hello External Object Variable CSS</h1>
		</div>
	)
}

export default ExtObjectVarCSS
